import "./App.css";
import Airport from "./Airport";
import { Switch, Route, Redirect, BrowserRouter } from "react-router-dom";

function App() {
  return (
    <>
      <Switch>
        <Route exact path="/">
          <BrowserRouter>
            <Airport />
          </BrowserRouter>
        </Route>
        <Route exact path="/passport">
          <Passport />
        </Route>
        <Route exact path="/profile">
          <Profile />
        </Route>
        <Route exact path="/travelling">
          <Travelling />
        </Route>
        <Route exact path="/*">
          <Redirect
            to={{
              pathname: "/",
            }}
          />
        </Route>
      </Switch>
    </>
  );
}

export default App;
